import React from "react";
import { MyContext } from "../context";
import { NavMain } from "../styledComponents/StyledComps";
import Icon from '@mdi/react'

import { mdiAccountCircleOutline, mdiHeartOutline, mdiCartOutline } from '@mdi/js';


export default function NavBar(){
	return(
		<MyContext.Consumer>
		{context => (
			<NavMain>
				<h1>MoMe</h1>

				{/* user icon */}
				<Icon path={mdiHeartOutline}
        title="Heart Favorites"
        size={1}
        color="black"
        />
				<Icon path={mdiAccountCircleOutline}
        title="User Profile"
        size={1}
        color="black"
        />




			</NavMain>
		)}
		</MyContext.Consumer>
	)
}
